import React from "react";
import {
  StyleSheet,
  Text,
  View,
  KeyboardAvoidingView,
  ImageBackground,
  TextInput,
} from 'react-native';
import { ThemeProvider, Input } from "react-native-elements";
import Icon from 'react-native-vector-icons/FontAwesome';

const Profile = () => {
  return (
    <ThemeProvider>
        <ImageBackground source={require('./img/background.jpg')} style={styles.backgroundImage}>
        <Input
          placeholder='Login'
          leftIcon={
            <Icon
              name='user'
              size={24}
              color='black'
              style={styles.Icon}
            />
          }
        />
        </ImageBackground>
    </ThemeProvider>
  );
};


const styles = StyleSheet.create({

  backgroundImage:{
    width: '100%',
    height: '100%',
  }
})




export default Profile;
